Историјата на статуси на пораките ги прикажува дејствата или грешките, директно и индиректно поврзани со проблемот:

 • Редоследот на настаните што довеле до моменталниот проблем;
 • Времепловот на настаните и времето меѓу настаните;
 • Историјата на настаните, како на пр., порака што не може ниту да се испрати ниту да се испорача;
 • Што се случило со испратените или примените пораки пред и по појавата на проблемот;
 • Сите промени меѓу содржините на пораката што ги примил и содржините на пораката што ги прегледал примачот
 • Прекините на Wi-Fi мрежата, мобилниот интернет и другите типови поврзувања;
 • Како влијаела дадена порака со проблем на други пораки или целиот разговор.

Вашиот нередактиран телефонски број може да покаже одредени проблеми поврзани со испраќање и примање пораки, како на пример:

 • Ненамерни промени на префиксот на телефонскиот број или форматирањето на локалните и меѓународните телефонски броеви;
 • Сите проблеми поврзани со вашиот телефонски број;
 • Проблеми со Wi-Fi, мобилен интернет и други проблеми со поврзување поврзани со Rich Communication Services (RCS).

Вашиот телефонски број се користи само за дијагностицирање и решавање проблеми. Google нема да контактира ниту со вас ниту со лицата поврзани со вашиот телефонски број.

Испраќачот не може да се потврди затоа што:

 • испраќачот %1$s не побарал од Google да ја потврди пораката;
 • Google не ја потврдил пораката поради технички проблеми;
 • некој се обидел да се претстави како %1$s.

Проценете ги содржините на поракава најдобро што можете.
